import React, {useState, useEffect} from 'react';
import CSGO from './Images/CSGO.png';
import './Games.css';
import axios from 'axios';

function Games({gamesData}) {
    const [data, setData] = useState([]);
    const [data1, setData1] = useState([]);
    const [data2, setData2] = useState([]);
    const [data3, setData3] = useState([]);
    var stringOne, stringTwo, stringThree;
    var GameOne, GameTwo, GameThree;

    console.log(gamesData)
    
    const fetchAPI = async() => {
        if(!gamesData){
            setData1("No games searched...");
            setData2("No games searched...");
            setData3("No games searched...");
        }
        else{
            let Games = [];
            
            for (let key in gamesData.games){
                Games.push(gamesData.games[key]);
            }

            stringOne = Games[0].replace('[', '');
            stringOne = stringOne.replace(']', '');
            stringOne = stringOne.replace(',', '');
            GameOne = stringOne.split(/\s(?=")/);

            stringTwo = Games[1].replace('[', '');
            stringTwo = stringTwo.replace(']', '');
            stringTwo = stringTwo.replace(',', '');
            GameTwo = stringTwo.split(/\s(?=")/);

            stringThree = Games[2].replace('[', '');
            stringThree = stringThree.replace(']', '');
            stringThree = stringThree.replace(',', '');
            GameThree = stringThree.split(/\s(?=")/);

            console.log(GameOne);
            console.log(GameTwo);
            console.log(GameThree);

            setData1(GameOne);
            setData2(GameTwo);
            setData3(GameThree);
        }
    };
     

    //Somewhere around here we need to parse through the strings,
    //remove quotes whenever we find them (as well as []'s), but also
    //use quotes as identifiers for the beginning and end of a string to use.
    

    
    useEffect(() => {
      fetchAPI()
    }, []);
    

  return (
    <div className = "games">
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>
                {data1 != "No games searched..." &&
                    data1.map((game, index) => (
                        <>
                            <span key={index}>{game}</span>
                            <br></br>
                        </>
                    ))
                }
                </p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>
                {data2 != "No games searched..." &&
                    data2.map((game, index) => (
                        <>
                            <span key={index}>{game}</span>
                            <br></br>
                        </>
                    ))
        }
                </p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>
                {data3 != "No games searched..." &&
                    data3.map((game, index) => (
                        <>
                            <span key={index}>{game}</span>
                            <br></br>
                        </>
                    ))
                }
                </p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">

                    </button>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Games;
